import { assertEquals } from "https://deno.land/std@0.201.0/assert/mod.ts";

// https://leetcode.com/problems/longest-substring-without-repeating-characters/

// Given a string s, find the length of the longest substring without repeating characters.

// Run using deno test challenges/javascript/lengthOfLongestSubstring/main.ts

function lengthOfLongestSubstring(s: string): number {
  let maxLength = 0;

  for (let i = 0; i < s.length; i++) {
    let letters = new Set();

    for (let j = i; j < s.length; j++) {
      if (letters.has(s[j])) {
        if (letters.size > maxLength) {
          maxLength = letters.size;
        }
        break;
      } else {
        letters.add(s[j]);
      }

      if (letters.size > maxLength) {
        maxLength = letters.size;
      }
    }
    
  }
        return maxLength
}

Deno.test("test simple tests", () => {
  const result1 = lengthOfLongestSubstring("abcabcbb");
  assertEquals(result1, 3);

  const result2 = lengthOfLongestSubstring(" ");
  assertEquals(result2, 1);

  const result3 = lengthOfLongestSubstring("dvdf");
  assertEquals(result3, 3);
});

